People want to feel seen. We want to be known. We want to be heard. We want to belong—somewhere; anywhere; nowhere. While community is the goal, it’s not always easy to attain because it requires a great deal of effort. Community is messy because it’s filled with humanity. But we cannot cease in our aim to have a perfectly imperfect body that’s welcoming and compassionate. It’s our goal to set the table for others to gather and dine. It’s the responsibility of the invitees to accept the invitation. Will we? See you Saturday. 🤟🏾♾️🫶🏾
