As a coach, I strive to provide my clients with a plan. It’s great they have goals and objectives, but they’re no good if they don’t have a workable plan they can implement. It’s one thing to want to lose weight, but what’s the plan? You may want to start a business or finally get your realtor’s license, but what’s your plan? If you don’t have a plan then your goal is aimless! Unfortunately, we don’t invest in plans as much as we invest in entertainment, and that’s ruining our goals. Sit down and calculate the amount of money you’ve spent on entertainment versus consultations/coaching with people who are where you want to be. We’d rather pay for Disney +, Hulu, Netflix, etc subscriptions instead of investing in life insurance for the family. Soooooo have your goals but just know that having them won’t change anything! Your mindset changes before your body, relationships and finances do. What are you reading? How much are you reading? Are you investing in changing your mindset. If not then it’ll just be another year without a plan that maintains the same you. Selah, 🤟🏾♾️🫶🏾.
